import React from 'react'
import Link from 'next/link'

const fakeData = [
    {
        id: 1,
        description: 'Product A',
        pricr: 130
    },
    {
        id: 2,
        description: 'Product B',
        pricr: 300
    },
    {
        id: 3,
        description: 'Product C',
        pricr: 600
    }
]

function Competition() {
    return (
        <div>
            {fakeData.map(prod => (
                <Link key={prod.id} href='/products/[competitionId]' as={'/competiton/${prod.id}'}>
                    <a>
                        <div>
                            {prod.description}
                        </div>
                    </a>
                </Link>
            ))}
        </div>
    )
}

export default Competition;
